package com.myjava.strivers.strings;

import static org.junit.Assert.assertEquals;

import org.junit.Test;

public class SeparateBlackWhiteBallsTest {
	@Test
	public void test1() {
		assertEquals(1, SeparateBlackWhiteBalls.minimumSteps("101"));
	}

	@Test
	public void test2() {
		assertEquals(2, SeparateBlackWhiteBalls.minimumSteps("100"));
	}

	@Test
	public void test3() {
		assertEquals(0, SeparateBlackWhiteBalls.minimumSteps("011"));
	}

	@Test
	public void test4() {
		assertEquals(0, SeparateBlackWhiteBalls.minimumSteps("111"));
	}

	@Test
	public void test5() {
		assertEquals(0, SeparateBlackWhiteBalls.minimumSteps("0000"));
	}
	
	@Test
	public void test6() {
		assertEquals(6, SeparateBlackWhiteBalls.minimumSteps("11000111"));
	}
	
	@Test
	public void test7() {
		assertEquals(7, SeparateBlackWhiteBalls.minimumSteps("01010001"));
	}
	
	@Test
	public void test8() {
		assertEquals(2500000000L, SeparateBlackWhiteBalls.minimumSteps(""));
	}
}
